import React, { Component } from 'react';
class QuoteDetail extends Component {
    constructor(props) {
        super(props);    
    }
    newQuote() {
        this.props.parentCallback();
    }
    editQuote() {

    }
    renderMeasurements() {
            var formInputList = this.props.dataFromParent.measurements;
            if(formInputList[0]) {
                const headerObj = formInputList[0][Object.keys(formInputList[0])];
            return (
                <div className="row mt-1">
                    {headerObj.map((item) => {
                        return (
                            <div className="col-sm">
                                <label>{item.name}</label>
                            </div>
                        )

                    })}
                <div className="col-sm">
                    <label></label>
                </div>
                </div>
            )
            }

    }
    render() {
        return (
            <div className="app flex-row align-items-center">


                <div className="list-group-header section-header row">
                    <div className="col">
                        <span className="mb-1 underline">Quote </span>
                        <span className="mb-1 blue-color pl-2"> Detail</span>
                    </div>
                    <div className="col text-right">
                        <button type="button" class="btn btn-primary btn-sm pr-4 pl-4" onClick={() => this.newQuote()}>New</button>
                        <button type="button" class="btn btn-primary btn-sm pr-4 pl-4 ml-2" onClick={() => this.editQuote()}>Edit</button>
                    </div>
                </div>
                <div className="quote-req">

                        <div>
                            <span className="underline blue">Title</span>
                            <p>{this.props.dataFromParent.title}</p>
                        </div>


                        <div>
                            <span className="underline blue">Description</span>
                            <p>{this.props.dataFromParent.content}</p>
                        </div>

                        <div>
                            <span className="underline blue">Submitted On</span>
                            <p>{this.props.dataFromParent.modifiedOn}</p>
                        </div>

                        <div>
                            <span className="underline blue">Status</span>
                            <p>{this.props.dataFromParent.status}</p>
                        </div>

                        <div>
                            <span className="underline blue">Measurements</span>
                        </div>

                        {this.renderMeasurements()}






                </div>
            </div>
        );
    }
}
export default QuoteDetail;
